commits.content:
@keyframes fadeIn{
    from{
      opacity: 0;
    }
    25%{
        opacity: 0.4;
    }
    50%{
        opacity: 0.8;
        font-weight: 600;
    }
    100%{
        opacity: 1;
        font-weight: 900;
    }
}

@keyframes fill-heart{
    0%{
        height: 0%;
       font-weight: 200;

        height: 100%;
        font-weight: 600;
    }
}

@keyframes scale{
    from{
        opacity: 0;
        transform : scale(0);
    }
    to {
        opacity: 1;
        transform : scale(1);
    }
}

@keyframes rotate{
    from{
        transform: rotate(0deg);
    }
    to{
        transform: rotate(360deg);
    }
}

@keyframes loading_menus{
    0%{
        opacity: 0;
        transform: translateY(500px);
    }
    50%{
        opacity: 0.5;
        transform: translateY(0);
    }
    100% {
        opacity: 1;
        transform: translateY(0);
    }
}

@keyframes loader{
    0%{
        transform: scale(1);
    }
    100%{
        transform: scale(0);
    }
}
